import { useNavigate } from "react-router-dom";


const Dashboard = () => {

    return <div>
        <h1>
            This is the Dashboard
        </h1>
        <h2>
            <button onClick={navigate('/auth')}>
                Click here to Login
            </button>
        </h2>
    </div>
}

export default Dashboard;
